// src/pages/Profile.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { profileApi } from '../services/api';
import { FaUser, FaEnvelope, FaPhone, FaMapMarkerAlt, FaLinkedin, FaGithub, FaGlobe } from 'react-icons/fa';

const Profile = () => {
  const navigate = useNavigate();
  const { user, isAuthenticated } = useAuth();
  const [profile, setProfile] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const loadProfile = async () => {
      try {
        if (!isAuthenticated || !user) {
          setError('Please log in to view your profile');
          setLoading(false);
          return;
        }

        const response = await profileApi.getProfile(user.id);
        // Check if we have profile data in the response
        if (response && response.id) {
          setProfile(response);
        } else {
          setError('Profile not found. Please create your profile.');
        }
      } catch (err) {
        console.error('Error loading profile:', err);
        setError('Failed to load profile. Please try again.');
      } finally {
        setLoading(false);
      }
    };

    loadProfile();
  }, [isAuthenticated, user]);

  const handleEditProfile = () => {
    navigate('/admin-dashboard');
  };

  if (loading) {
    return (
      <div className="profile-page-container">
        <div className="profile-page-loading">
          <div className="spinner"></div>
          <p>Loading profile...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="profile-page-error">
        <p>{error}</p>
        <button className="btn-primary" onClick={handleEditProfile}>
          Create Profile
        </button>
      </div>
    );
  }

  if (!profile) {
    return (
      <div className="profile-page-container">
        <div className="profile-page-error">
          <p>No Profile Found!</p>
          <button className="btn-primary" onClick={handleEditProfile}>
            Create Profile
          </button>
        </div>
      </div>
    );
  }

  // Parse skills if they're stored as a JSON string
  const skills = typeof profile.skills === 'string' 
    ? JSON.parse(profile.skills) 
    : profile.skills || [];

  return (
    <div className="profile-page-container">
      <div className="max-w-4xl mx-auto">
        <div className="bg-white rounded-lg shadow-lg overflow-hidden">
          {/* Profile Header */}
          <div className="profile-page-header">
            <div className="profile-page-image-container">
              {profile.profile_image ? (
                <img
                  src={profile.profile_image}
                  alt={profile.name}
                  className="profile-page-image"
                />
              ) : (
                <div className="profile-page-image-placeholder">
                  <FaUser size={48} />
                </div>
              )}
            </div>
            <button
              className="profile-page-edit-button"
              onClick={handleEditProfile}
            >
              Edit Profile
            </button>
          </div>

          {/* Profile Content */}
          <div className="profile-page-content">
            <h1 className="profile-page-name">{profile.name}</h1>
            <p className="profile-page-bio">{profile.bio}</p>

            {/* Contact Information */}
            <div className="profile-page-section">
              <h2 className="profile-page-section-title">Contact Information</h2>
              <div className="profile-page-contact-info">
                {profile.email && (
                  <div className="profile-page-contact-item">
                    <FaEnvelope />
                    <span>{profile.email}</span>
                  </div>
                )}
                {profile.phone && (
                  <div className="profile-page-contact-item">
                    <FaPhone />
                    <span>{profile.phone}</span>
                  </div>
                )}
                {profile.location && (
                  <div className="profile-page-contact-item">
                    <FaMapMarkerAlt />
                    <span>{profile.location}</span>
                  </div>
                )}
              </div>
            </div>

            {/* Social Links */}
            {profile.socialLinks && Object.keys(profile.socialLinks).length > 0 && (
              <div className="profile-page-section">
                <h2 className="profile-page-section-title">Social Links</h2>
                <div className="profile-page-social-links">
                  {profile.socialLinks.linkedin && (
                    <a
                      href={profile.socialLinks.linkedin}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="profile-page-social-link"
                    >
                      <FaLinkedin />
                      LinkedIn
                    </a>
                  )}
                  {profile.socialLinks.github && (
                    <a
                      href={profile.socialLinks.github}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="profile-page-social-link"
                    >
                      <FaGithub />
                      GitHub
                    </a>
                  )}
                  {profile.socialLinks.portfolio && (
                    <a
                      href={profile.socialLinks.portfolio}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="profile-page-social-link"
                    >
                      <FaGlobe />
                      Portfolio
                    </a>
                  )}
                </div>
              </div>
            )}

            {/* Work Experience */}
            {profile.work_experience && (
              <div className="profile-page-section">
                <h2 className="profile-page-section-title">Work Experience</h2>
                <div className="profile-page-experience-list">
                  {profile.work_experience.map((exp, index) => (
                    <div key={index} className="profile-page-experience-item">
                      <h3 className="profile-page-experience-title">{exp.title}</h3>
                      <p className="profile-page-experience-company">{exp.company}</p>
                      <p className="profile-page-experience-date">
                        {exp.start_date} - {exp.end_date || 'Present'}
                      </p>
                      <p className="profile-page-experience-description">{exp.description}</p>
                    </div>
                  ))}
                </div>
              </div>
            )}

            {/* Projects */}
            {profile.projects && (
              <div className="profile-page-section">
                <h2 className="profile-page-section-title">Projects</h2>
                <div className="profile-page-projects-grid">
                  {profile.projects.map((project, index) => (
                    <div key={index} className="profile-page-project-card">
                      <h3 className="profile-page-project-title">{project.title}</h3>
                      <p className="profile-page-project-description">{project.description}</p>
                      {project.technologies && project.technologies.length > 0 && (
                        <div className="profile-page-technologies-list">
                          {project.technologies.map((tech, techIndex) => (
                            <span
                              key={techIndex}
                              className="profile-page-technology-tag"
                            >
                              {tech}
                            </span>
                          ))}
                        </div>
                      )}
                    </div>
                  ))}
                </div>
              </div>
            )}

            {/* Skills */}
            {skills.length > 0 && (
              <div className="profile-page-section">
                <h2 className="profile-page-section-title">Skills</h2>
                <div className="profile-page-skills-list">
                  {skills.map((skill, index) => (
                    <span
                      key={index}
                      className="profile-page-skill-tag"
                    >
                      {skill}
                    </span>
                  ))}
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
